package com.wuliangit.elevator.spider;

import java.util.ArrayList;
import java.util.Iterator;
import java.util.List;

/**
 * Created by nilme on 2017/6/16.
 */
public class Common {

    //中标状态
    public static final String BID_STATE_ZHONGBIAO = "ZHONGBIAO";
    //招标状态
    public static final String BID_STATE_ZHAOBIAO = "ZHAOBIAO";

    //招标关键字
    public static final String BID_ZHAOBIAO_KEYWORD = "招标公告";
    //中标关键字
    public static final String BID_ZHONGBIAO_KEYWORD = "中标";
    public static final String BID_ZHONGBIAO_KEYWORD2 = "招标结果";
    public static final String BID_ZHONGBIAO_KEYWORD3 = "评标结果";

    //柯桥参数
    public static final String VIEWSTATE = "";

    //柯桥参数
    public static final String EVENTVALIDATION = "/wEWBgLqvJ3fBQLBzejUCQLP4/6gAQKIwZ+lDgKXwZ+lDgLDsvv1Cn4r/l8L4a8s5ra8GktjupmOXdML";

     //是否包含招标关键词
    public static boolean hasZhaoBiaoKeyword(String queryParam){
        boolean b = false;
        List<String> zhaoBiaoKeywodList = new ArrayList<String>();
        zhaoBiaoKeywodList.add(BID_ZHAOBIAO_KEYWORD);
        Iterator keywordIterator = zhaoBiaoKeywodList.iterator();
        while(keywordIterator.hasNext()){
            String keyword = (String)keywordIterator.next();
            if(queryParam.contains(keyword) && queryParam.contains("电梯")){
                return true;
            }
        }
        return b;
    }


    //是否包含中标关键词
    public static boolean hasZhongBiaoKeyword(String queryParam){
        boolean b = false;
        List<String> zhongBiaoKeywodList = new ArrayList<String>();
        zhongBiaoKeywodList.add(BID_ZHONGBIAO_KEYWORD);
        zhongBiaoKeywodList.add(BID_ZHONGBIAO_KEYWORD2);
        zhongBiaoKeywodList.add(BID_ZHONGBIAO_KEYWORD3);
        Iterator keywordIterator = zhongBiaoKeywodList.iterator();
        while(keywordIterator.hasNext()){
            String keyword = (String)keywordIterator.next();
            if(queryParam.contains(keyword) && queryParam.contains("电梯")){
                return true;
            }
        }
        return b;
    }
}
